import { Routes, Route } from "react-router-dom";
import RootLayout from "../src/root/RootLayout";
import AuthLayout from '../src/auth/AuthLayout'
import SignUp from "../src/auth/signup";
import SignIn from "../src/auth/signin";
import Home from "./root/pages/Home";

import "./index.css";
import AllUsers from "./root/pages/AllUsers";
import Saved from "./root/pages/Saved";
import CreatePost from "./root/pages/CreatePost";
im

const App = () => {
  return (
    <main className="flex h-screen">
      <Routes>
        {/* public routes */}
        <Route element={<AuthLayout />}>
          <Route path="/sign-in" element={<SignIn />} />
          <Route path="/sign-up" element={<SignUp />} />
        </Route>

        {/* private routes */}
        <Route element={<RootLayout />}>
          <Route index element={<Home />} />
          <Route path='/all-users' element={<AllUsers />} />
          <Route path='/saved' element={<Saved />} />
          <Route path='/create-post' element={<CreatePost />} />
          <Route path='/update-post/:id' element={<EditPost />} />
          <Route path='/posts/:id' element={<PostDetails />} />
          <Route path='/profile/:id/*' element={<Profile />} />
          <Route path='/update-profile/:id' element={<EditProfile />} />
        </Route>

      </Routes>
    </main>
  );
};

export default App;
